(1, 1, 'Phone call with Bridget', 'Bridget would like costs. School wants to add two pages of AO content to Lucas public speaking.\n\nWe''ll need the speak assignments, speech tools for Lucas and a Learnsmart copy with remapped ebook links if necessary.', 1347380388, 61, '68.58.147.59'),
(2, 1, 'Email Spec', 'Email Spec\nOverview: A Custom Connect Plus site based off The Art of Public Speaking, Lucas 11th ed (0077428129). The customized portion will be the addition of AO material into the ebook. \n\nDetails: \nThe Connect Plus Site will include the following items:\n\nEbook- The complete national Lucas book with the addition of two pages of AO content. The AO content will be added to the ebook in Chapter 1 on page 22 before speaking multiculturally. \n\nLearnsmart- A copy of the national Lucas Learnsmart will be made.\n\nOLC- We will link to the national OLC site.\n\nTest Bank Content- All national EZtest content will be pulled over from the national site to the custom site. (0077428129)\n\nBook and Discipline Specific Content- The following tools will also be included in the site: Speech Capture Tool and Speech preparation tools (Topic helper, outline tool, easybib, survey monkey)\n\nAccess and Support\nStudents will access the site via the instructor provided URLS. Registration will be completed online at which point they can purchase via eCommerce or enter an access code from a printed card if available.\nInstructors will need to use the custom site to create their section URLs. This will likely be in Combinations or similar. The CA will provide a screenshot to the LSC of the site location.\n\nSupport will be provided by CXG. \n\nDelivery Timelines\nSite development can begin when the necessary ISBNs are made available. Delivery can be expected by December 15th, 2012.', 1347903223, 61, '68.58.147.59'),
(3, 5, 'Notes from call', 'Goal is to keep the assessments linked to Connect, ideally living completely within Connect.\nSet up pilot for Spring 2013, enrollment 500-1000 students, five faculty.', 1347993105, 61, '68.58.147.59'),
(4, 5, 'Conference Call 9/21/2012', 'Looking deeper into hosting this report within Connect.\n\nScheduling call for 10/12/2012', 1348240395, 61, '68.58.147.59'),
(5, 10, 'Call with Jennie', 'Print book with DVD. Take that book and build it as an ebook\n\nPut videos in the ebook\n\nImages where they have the person signing in the hands. \n\nThird volume that is not published yet. \n\nWhen can we have the manuscript and DVD.\n\nNothing is ready yet.\n\nSummer late May early June.\n\nDVD is a compliment to the book. Within the book there are pictures. Mapping needed. \n\nWhere does the solution live? \n\niOS and andriod compatiable. If they can watch while on the phone/tablet.\n\nNot just a PDF ebook. \n\nThey use angel. They not longer have access to the material.... \n\nwould still want to have access after they complete. At least two years of access maybe even 3 years. More common that students take three years.\n\nAt the end of each unit there are practice sentence. Self assessment. Left up to the individual instructor as far as other assignments.\n\nDVD only contains fine vocab. All practice sentence.\n\nCan speech capture be used? Mobile app that captures. \n\n\n\n\n\n', 1348846204, 61, '68.58.147.59'),
(6, 13, 'Provided Plant Costs', 'Gave estimate to Christy for 2250', 1349898927, 61, '68.58.147.59'),
(7, 15, 'Sent DTS sites to Ryan', 'BIO 2215 â€“  007804491X (Kidane cover)\nBIO 2262 - 0078045843 (Sellars)\nBIO 2300 â€“ 0077563220 (Grine)\n \nCHEM 0100 Book â€“ 0078045290 (Hailu book)\nCHEM 0100 Lab â€“ 0078045649 (Hailu lab)\nCHEM 1111 - 0078045487  (Lord)', 1350053740, 61, '68.58.147.59'),
(8, 16, 'Email Spec', 'Overview -      A Custom Connect plus site built off two existing national sites. \n\n\nProject: Decision Making with Accounting duplicated\ni. Quick Tips:\nChapter from Connect Quick Tips by McGraw-Hill, 2012\nii. McGraw-Hill Connect Student Quick Tips for Blackboard Users: Chapter from McGraw-Hill Connect Student Quick\nTips for Blackboard Users by McGraw-Hill, 2012\niii. Pointing Students in the Right Direction:\nChapter from Introduction to Managerial Accounting, Sixth Edition by Brewer,\nGarrison, Noreen, 2013\niv. Student Supplements:\nChapter from Introduction to Managerial Accounting, Sixth Edition by Brewer, Garrison, Noreen,\n2013\n\nT E X T B O O K C H A P T E R S\n1. Prologue: Managerial Accounting: An Overview:\nChapter from Introduction to Managerial Accounting, Sixth Edition\nby Brewer, Garrison, Noreen, 2013\n2. Managerial Accounting and Cost Concepts:\nChapter 1 from Introduction to Managerial Accounting, Sixth Edition by\nBrewer, Garrison, Noreen, 2013\n3. Cost-Volume-Profit Relationships:\nChapter 5 from Introduction to Managerial Accounting, Sixth Edition by Brewer,\nGarrison, Noreen, 2013\n4. Planning for Profit and Cost Control:\nChapter 7 from Fundamental Managerial Accounting Concepts, Sixth Edition by\nEdmonds, Tsay, Olds, 2011\n5. Performance Evaluation:\nChapter 8 from Fundamental Managerial Accounting Concepts, Sixth Edition by Edmonds,\nTsay, Olds, 2011\n6. Performance Measurement in Decentralized Organizations: Chapter 9 from Introduction to Managerial Accounting,\nSixth Edition by Brewer, Garrison, Noreen, 2013\n7. Capital Budgeting Decisions:\nChapter 11 from Introduction to Managerial Accounting, Sixth Edition by Brewer, Garrison,\nNoreen, 2013\n8. Differential Analysis: The Key to Decision Making:\nChapter 10 from Introduction to Managerial Accounting, Sixth\nEdition by Brewer, Garrison, Noreen, 2013\n9. Cost Accumulation, Tracing, and Allocation:\nChapter 4 from Fundamental Managerial Accounting Concepts, Sixth\nEdition by Edmonds, Tsay, Olds, 2011\n10. Cost Management in an Automated Business Environment ABC, ABM, and TQM: Chapter 5 from Fundamental\n\n The site will include a textflow ebook made up of these chapter above. A matching custom OLC will also be created. The site will also include a custom Learnsmart made up of the chapters above. \n\nAccess - Instructors will access the site via Connect.mcgraw-hill.com. Learning Solutions will provide directions on where to find this site within the Connect system. We will also schedule a walkthrough of the site with the instructor(s).\nStudents will access the site via the instructor created section urls. They will be required to purchase during registration OR enter an access code from a print card.\n\nTimeline - It will take approximately 6 weeks to complete this build once we receive the Custom ISBNs. Hard dates will be provided at that point.', 1350583057, 61, '68.58.147.59'),
(9, 5, 'Conference call 10/17/2012', 'Need to revise specs with vendor', 1350587452, 61, '68.58.147.59'),
(10, 9, 'Sent follow up message', 'I had sent the revised list of assets on Oct 4th. Haven''t heard anything back yet.', 1351098700, 61, '68.58.147.59'),
(11, 9, 'Assets list', 'Hi Rhonda,\n\nHere is the revised list\n\nAssignable content\n	General Assumptions:\n	no ebook references in question or learning objectives\n	Questions will be built into Angel''s assessment engine and therefore formatting my not be consistent with Connect\n\n\n	Can Include\n		Internet Activities\n		Learning Objective Quiz\n		Reading Assignment\n		Post-Test\n		Pre-Test\n		Life Stories\n		Video and Questions\n		You Make the Call\n		Public Health is Personal\n		Who''s at Risk?\n		College Health Report Video\n\n	\n	Cannot Include\n		Interactive Activity \n		Personal Health Portfolio - could potentially be rebuilt\n		Daily Fitness and Nutrition Journal\n		Behavior Change Workbook\n		Myth/Fact Video\n		You Make the Call Application  (Does not go live until December)', 1351098723, 61, '68.58.147.59'),
(12, 16, 'Plant Costs', '5600 \n\n6.50 per page plus 2500 for site with Custom Learnsmart and OLC.', 1351177816, 61, '68.58.147.59'),
(13, 16, 'Added plant costs', '6600 to project 259376', 1351534188, 61, '68.58.147.59'),
(14, 23, 'Contract Language', '', 1351791782, 61, '68.58.147.59'),
(15, 23, 'Waiting on ISBN', '', 1351791796, 61, '68.58.147.59'),
(16, 17, 'Added Costs', '3100 Dollars', 1351799065, 0, '68.58.147.59'),
(17, 20, 'Email', '\nOverview\nA custom Coursesmart ebook built off of Rumsey: How to find Information, 2nd edition to be delivered via D2L courses.\nDetails\nThe ebook will be built using the Coursesmart platform. This platform includes the following features:\nNote taking\nHighlighting\nBookmarking\niOS, Andriod and desktop browser compatibility.\nDownloadable chapters\n\nThe book''s Table of Contents will be as follows:\nList of figures \nList of tables \nList of abbreviations \nForeword to the first edition \nPreface \nAcknowledgements\nThe information gathering process \nMaking the most of a library \nFinding information about existing research \nThe type and detail of information required \nDiscovering relevant materials \nThe online searching process \nCitation searching\nObtaining the full text \nUsing the World Wide Web for research \nAccessing materials \nEvaluation of resources \nCiting references \nKeeping records \nIntellectual property and plagiarism \nThe research community and keeping up to date \nThe changing landscape of research\nSummary checklist \nAppendix 1: Using a library \nAppendix 2: Formats of information sources \nGlossary \nReferences and bibliography \nWeb addresses \nIndex\nAccess\nStudents will access the book via D2L course. McGraw-Hill Learning Solutions requires that Oakton provide a course shell in order for McGraw-Hill to insert the direct links to the custom ebook. Instructors will need to copy the direct links to their respective courses. Students accessing the links will not enter access codes. McGraw-Hill will bill the school for book access based on enrollments.\n\nDelivery\nDevelopment requires approximately 4 weeks from the time and ISBN is made available. Other contingencies include the course shell availability and audit bill capabilities.', 1351799837, 61, '68.58.147.59'),
(18, 29, 'Added Costs', '1500 dollars for costs to copy 9th edition of Living with Art and adding in Learnsmart for 10th edition of Living with Art.\n\nCosts added to spreadsheet ', 1352474123, 61, '68.58.147.59'),
(19, 30, 'OLC information', 'http://highered.mcgraw-hill.com/sites/007811716x/information_center_view0/', 1352487134, 61, '68.58.147.59'),
(20, 30, 'Table of Content', 'Chapter 1: Introduction \nChapter 2: Puberty, Health, and Biological Foundations \nChapter 3: The Brain and Cognitive Development \nChapter 4: The Self, Identity, Emotion, and Personality \nChapter 5: Gender \nChapter 6: Sexuality\nChapter 7: Moral Development, Values, and Religion \nChapter 8: Families \nChapter 9: Peers, Romantic Relationships, and Life Styles \nChapter 10: Schools \nChapter 11: Achievement, Work, and Careers \nChapter 12: Culture \nChapter 13: Problems in Adolescence and Emerging Adulthood\nAppendix: Careers in Adolescent Development', 1352491513, 61, '68.58.147.59'),
(21, 30, 'Costs are....', '6000\n4500 for textflow book\n1500 for site shell and testbanks', 1352491571, 61, '68.58.147.59'),
(22, 9, 'ebook costs are ...', '3000 plus 1.50 per student royalty\n', 1352493330, 61, '68.58.147.59'),
(23, 30, 'Included Testbanks', '1. 007811716X/  9780078117169 - Adolescence, 14e Santrock\n2. 0078035325/  9780078035326 - LifeSpan Development, 14e Santrock\n3. 0078035317/  9780078035319 - Connect ISBN 0077425375, Human Sexuality, 8e, Yarber\n4. 0078035511/  9780078035517 - Connect ISBN 0077545001, CHILD, \n ', 1352833292, 61, '68.58.147.59'),
(24, 30, 'Regarding the Child Content', '"Eric,\n \nFor mid-December, I expect everything to be live except for the Milestones for Chs 6-16.  Those should be live in early January.\n \nLet me know if there is anything I can do to help.\n \nIs Triton adopting CHILD or another product and you are using CHILD content?  If CHILD, who is the prof (Iâ€™m curious about reviewers)?\n \nThanks,\n\nCara Labell"', 1352837215, 0, '68.58.147.59'),
(25, 30, 'Regarding the Yarber Content', '"Hi Eric,\n \nI donâ€™t know offhand, but the live date for this Connect is 1/1/2013, which means that content should be finalized by 12/15. I already have the OLC testbanks completed- if that would be any use just let me know and Iâ€™ll be happy to send it along.  \n \nI have a question out to our Digital Content Developer Sarah Colwell regarding this, so Iâ€™ll keep you informed once I get an answer from her.\n \nThanks,\nKevin"', 1352837244, 0, '68.58.147.59'),
(26, 9, 'Costs added', '6100 added to plant costs', 1352913994, 61, '68.58.147.59');
